import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const ReadOrder = () => {
    const [orders, setOrder] = useState([]);

    const getOrders = async () => {
        const result = await axios.get("http://localhost:3003/users");
        setOrder(result.data.reverse());
    };

    useEffect(() => {
        getOrders();
    }, []);

    const deleteUser = async id => {
        await axios.delete(`http://localhost:3003/users/${displayOrderId}`);
        getOrders();
    };

    return (
        <div className="container">
            <div className="py-4">
                <h1>Read Order</h1>
                <table class="table border shadow">
                    <thead className='thead-dark'>
                        <tr>
                            <th>displayOrderId</th>
                            <th>customerName </th>
                            <th>productName</th>
                            <th>mobileNo</th>
                            <th>modelNo</th>
                            <th>brandName</th>
                            <th>ProductColor </th>
                            <th>category</th>
                            <th>subCategory</th>
                            <th>discription</th>
                            <th>orderDate </th>
                            <th>expectedDeliveryDate</th>
                            <th>logisticName</th>
                            <th>awbNo</th>
                            <th>couponCode </th>
                            <th>action </th>
                        </tr>
                    </thead>
                    <tbody>
                        {orders.map((order) => (
                            <tr key={order.displayOrderId}>
                                <td >{order.displayOrderId}</td>
                                <td>{order.customerName}</td>
                                <td>{order.productName}</td>
                                <td>{order.mobileNo}</td>
                                <td>{order.modelNo}</td>
                                <td>{order.brandName}</td>
                                <td>{order.ProductColor}</td>
                                <td>{order.category}</td>
                                <td>{order.subCategory}</td>
                                <td>{order.discription}</td>
                                <td>{order.orderDate}</td>
                                <td>{order.expectedDeliveryDate}</td>
                                <td>{order.logisticName}</td>
                                <td>{order.awbNo}</td>
                                <td>{order.couponCode}</td>
                                <td>
                                    <Link class="btn btn-primary mr-2" to={`/users/${order.displayOrderId}`}>
                                        View
                                    </Link>
                                    <Link
                                        class="btn btn-outline-primary mr-2"
                                        to={`/UpdateOrder/${order.displayOrderId}`}
                                    >
                                        Edit
                                    </Link>
                                    <Link
                                        class="btn btn-danger"
                                        onClick={() => deleteUser(order.displayOrderId)}
                                    >
                                        Delete
                                    </Link>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default ReadOrder;
